def poly_hdx_post(self, url, data=None, **kwargs):
    method = kwargs.pop('method', '') or 'POST'

    url = url.replace('/rest/', '')

    from provider.exceptions import AuthenticationError, ResponseError

    if 'auth_error' in self.endpoint.hostname:
        raise AuthenticationError('')

    if 'response_error' in self.endpoint.hostname:
        raise ResponseError('')

    if 'invalid_xml' in self.endpoint.hostname:
        return FakeResponse('''<?xml version="1.0"?><Status></Invalid>''')

    def ret(response, url):

        if isinstance(response, state.State):
            response = response.get(state.url_state) or response.get('initial')

        if hasattr(response, 'read'):
            response.seek(0)
            response = response.read()

        if isinstance(response, tuple):
            return FakeResponse(response[1], status_code=response[0], url=url)
        else:
            return FakeResponse(response, url=url)

    if url == 'a_apicommand.cgi':
        return ret(_mock_command(data.get('apicommand', []), state.url_state) if data else [], url)

    for call, response in sorted(iter(list(poly_hdx_requests.items())), key=lambda x: -len(x[0])):

        if call in '%s %s' % (method, url):
            return ret(response, url)

    print("Missing poly_hdx mock for {}".format(url))
    return FakeResponse({"error": "Missing mock for {}".format(url)}, url=url, status_code=404)


def _mock_command(commands, url_state: str = 'initial'):
    base = '''
    <?xml version='1.0' standalone='yes'?>
<apicommands>
{}
</apicommands>
'''.strip()
    # TODO real structure
    if len(commands) != 0:
        nodes = [
            '''<apicommand>
            <command status="success">{}</command>
            <result>{}
    </result>
        </apicommand>'''.format(
                cmd, poly_hdx_commands.get(cmd).get(url_state) if isinstance(poly_hdx_commands.get(cmd), state.State) else poly_hdx_commands.get(cmd)
            )
            for cmd in str(commands[0]).split(';')[0:-1]
        ]

    # print('\n==============nodes===========')
    # print(nodes)
    return base.format('\n'.join(nodes))
